import React from "react";
import { Link,useNavigate  } from "react-router-dom";
import axios from "axios";
import img1 from './assests/images/search.png';
import { useState,useEffect } from "react";

import './assests/css/OpenPage.css';
import './assests/css/main.css';
import './assests/css/main.css.map';
import "./assests/js/main.js";
import './assests/scss/_layouts/_header.scss';
import './assests/scss/_layouts/_navigation.scss';
import './assests/scss/abstract/_font.scss';
import './assests/scss/abstract/_variables.scss';
import './assests/scss/components/_switch.scss';
import './assests/scss/forms/login.scss';
import './assests/scss/forms/reg.scss';
import './assests/scss/main.scss';

export default function OwnerPage(){

  const navigate=useNavigate();

  const [images,setImages]=useState({
    picname:[]
  })
 const [mailId , setMailId]=useState("ASHOK@gmail.com")

  const[vehicle,setVehicle]=useState({
    vehicleName:"",
    modelNo:"",
    picDict:'',
    imgName:""
  })
  
  
  // useEffect(()=>{
  // getdata();
  // }, [])
  
  function handleChange(event)
  {
    const{name,value}=event.target;
    setVehicle((preState)=>{
      return{
        ...preState,
      [name]:value,
      }
    })
  }
  
  function change(event){

    setVehicle((preState)=>{
      return{
        ...preState,
       picDict:event.target.files[0],
      };
    })

    setVehicle((preState)=>{
      return{
        ...preState,
       imgName:event.target.files[0].name,
      };
    })

  };
  
  function getdata(){
    axios
    .post('/getpics',"hi pa")
        .then((res)=>{
          //console.log(res.data[8])
          setImages((preState)=>{
            return{
              ...preState,
             picname:res.data,
            };
          })
          //console.log(picname[9]);
         
        })
        .catch((err)=>{
        console.log(err)});
        }


  const{picname}=images
  const{vehicleName,model,picDict,imgName}=vehicle


  console.log(vehicleName);
  console.log(model);
  console.log(imgName);

  function sendData(){
    const formdata=new FormData();
    formdata.append('vehicleName',vehicleName);
    formdata.append('model',model);
    formdata.append('picDict',picDict);
    formdata.append('imgName',imgName);
    formdata.append('mailId',mailId);

    axios
    .post('/sendData',formdata)
    .then((res)=>console.log(res.data))
    .catch((err)=>console.log(err))
    navigate('/OwnerPage')
  }














    return(
        <>
 <div className="header up1" style={{position:'sticky'}} >
 {/* <img className="mx_img" src={require( './images/bk.jpg')} alt="" /> */}
      <nav className="navbar up" style={{position:'sticky'}}>
        <div >
        <img src={require('./images/pic.jpg')}  width='50px' height='50px'/>
        </div>
        <h1 className="head1" >ASHOK A</h1>
        <ul className="navbar--items ulSt">
          <li className="navbar--1">
            <a href="./index.html">Home</a>
          </li>
          <li className="navbar--1">
            <a href="#">About</a>
          </li>
          <li className="navbar--1">
            <a href="#">Contact</a>
          </li>
          
        </ul>
        <div className="search" >
          <input className="search--tbox" type="text" />
          <button className="search--btn">
            <img src= {img1} alt="" className='oneim' />
          </button>
        </div>
      </nav>
      
      
      </div>             
      
      <div  className="up1">
        <pre>
      <div className="topDet">
        <div >
        <br/><br/><br/>
        <h1>                           Name:     ASHOK A</h1><br/><br/>
        <h1>                           Mail Id:     ashokarunachalam333@gmail.com</h1><br/><br/>
        <h1>                           Mobile Number:   9486444911</h1><br/><br/>
        </div>
      </div>
      </pre>
      <hr/>
      <div>
        <br/>
        <div className="topDet2">
      <h1 >Upload Vehicle:-</h1>
      </div>
      
      <br/><br/><br/>
      <div className="topDet3">
        <form >
        <input className="ip1" required type="text" name="vehicleName" value={vehicleName} onChange={handleChange} placeholder="Name of the Vechicle*"></input> 
        <input className="ip2" required type="text" name="model" value={model} onChange={handleChange} placeholder="Model of the Vechicle*"></input> 
         <input className="ip3" required type="file" name="imgName" onChange={change} /><br/><br/> 
        <input className="ip4"type='submit' />
        </form>
      </div>
      <br/><br/><br/>
      <br/>
      <br/>
      </div>
      <hr/>
      <div className='album'>
      { picname.map(({  profile,id }) => <div className='gallery we '  >
      <img width="600" height="400" key={id} src={require( './images/'+profile)} />
      <div  className='desc' ><button className='noselect btnrent' key={id} >Rent</button></div>
      </div>
      )}
      </div>
      </div>
        </>
    );
}
